package ua.tqs.cito;

import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.autoconfigure.web.servlet.WebMvcTest;
import org.springframework.boot.test.mock.mockito.MockBean;
import org.springframework.test.web.servlet.MockMvc;

import io.restassured.module.mockmvc.RestAssuredMockMvc;

import static org.hamcrest.Matchers.equalTo;
import static org.mockito.ArgumentMatchers.any;
import static org.mockito.Mockito.*;

@WebMvcTest(ProductsController.class)
public class ProductControllerTests {
	
		@Autowired
	    private MockMvc mvc;

	    @MockBean
	    private ProductRepository repo;
	    
	    @Test
	    public void whenPostinProductReturnIt( ) throws Exception {
	    	Product p = new Product("Benuron","Farm√°cia Geral","Great for small pains!",13.00,"");
	    	
	    	RestAssuredMockMvc.mockMvc(mvc);

	        when( repo.save(any()) ).thenReturn(p);

	        
	        RestAssuredMockMvc.given().header("Content-type","application/json").body("{\"name\":\"Benuron\",\"category\":\"Farm√°cia Geral\",\"description\":\"Great for small pains!\",\"price\":13.00,\"image\":\"\"}").post("http://localhost:8000/product/register").then().statusCode(200).body("name",equalTo("Benuron"));


	    }

}
